create table contracts (
	id INT NOT NULL AUTO_INCREMENT,
	created_at DATETIME,
	employee_id INT,
	status VARCHAR(255),
	date_effective DATE,
	date_contract_begin DATE,
	date_contract_end DATE,
	weekly_hours INT,
	type VARCHAR(255),
	pay_amount INT,
	pay_type VARCHAR(255),
	note VARCHAR(255),
	scan_url VARCHAR(255),
	PRIMARY KEY (id)
);
